//Annonse Hahaha! Nå har Caroline fått kjørt seg litt bak kamera.. Er man på helgetur hos en blogger, blir man garantert spurt om litt fotohjelp, og ingenting er kjekkere enn at hjelpen kommer med god innlevelse. Her snakker vi engasjement, skal jeg fortelle dere, og Caroline la seg rett på bakken for å knipse bilder fra de beste vinklene.. Hun er så skjønn ass, haha. Dagens rekvisita er Solo-goodies, og Solo-goodies er faktisk noe av det kuleste som finnes. Er dere ikke enig? Hvor fett er det i
..........
sendt til deg i løpet av kort tid. You get the concept? Hvis du ikke skulle være en av de heldige vinnerne, får du i stedet Solo-dollar. Når du har samlet nok penger, kan du hente deg en gratis Solo, og det er jo innafor siden Solo er den beste brusen i verden! Solo er LIVET! Nytt fra juni er at du også kan vinne i appen ved å bruke koder som du finner på Solo-flasken, så i sommer blir det altså ekstra enkelt å vinne digg Solo-stasj som bl.a solbriller, ryggsekk, retro bag, badehåndkle, flipflop
